import React from "react";
import { Link } from "react-router-dom";

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
      <nav>
        <Link to="/books"><button>List of Books</button></Link>
        <Link to="/profile"><button>Profile</button></Link>
        <Link to="/fees"><button>My Due Fees</button></Link>
        <Link to="/taken"><button>Books Taken</button></Link>
      </nav>
    </div>
  );
}

export default Dashboard;
